import Head from 'next/head';
import NavigationBar from '../NavigationBar/NavigationBar';

const MasterPage = (props) =>(
    <div>
        <Head>
            <title>Bitcoin App</title>
        </Head>
        <NavigationBar />
        {props.children}
    </div>
)

export default MasterPage;
